  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link II at waypoints along its track during fourteen dives of the 2003
  \"Investigating the Charleston Bump\" expedition sponsored by the National Oceanic
  and Atmospheric Administration (NOAA) Office of Ocean Exploration, August 2 through
  August 16, 2003. Measurements and information include sub's position and depth;
  personnel assignments; dive, mission, target, and vehicle ID's; dive comments; hyperlinks
  to CTD plots; water temperature; and salinity. The Marine Operations Division of
  the Harbor Branch Oceanographic Institution provided the original submersible data.
  Quality assurance included a comparsion and synchronization of dive log waypoint
  depths and CTD depths, review of minimum and maximum values, and deletion of bad
  values.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
